import { makeStyles } from '@mui/styles'
import React from 'react'

export default function Layout({children}) {
    const classes = makeStyles({
        page:{
            background:'#f9f9f9',
        }
    })
  return (
    <div>
        <div className={classes.page}>
            {children}
        </div>
    </div>
  )
}
